css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("https://www.atlassian.com/git/tutorials/") {
  
  .topbar {
    background-color: #474747;
  }
  
  body {
    color: #bcbcbc;
    background-color: #282828;
  }
  
  .tutorial-detail {
    background-color: #282828;
  }
  
  h1, h2, h3, h4, h5, h6 {
    color: #ccc;
  }
  
  code, p code, li code {
    color: #ccc;
  }
  
  /* Articles Bkgd */
  .page-wrap.-gray-bg {
    background-color: #222;
  }
  
  /* Side Pop-up Pane */
  .tutorial-detail .related-post {
    background-color: #222;
    border-left-color: #222;
  }

}
